package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class WeaponPo {	public final int id;	public final int room;	public final int en;	public final int precision;	public final int mess;	public final int complexity;	public final int range;	public final String type;	public final String value;	public final int dur;	public final int critrate;	public final int avoidrate;	public final int agi;	public final int push;	public final float DPH;	public final int surplus;	public final String asking;	public final String answers;

	public WeaponPo( WeaponPo clone ){		this.id = clone.id;		this.room = clone.room;		this.en = clone.en;		this.precision = clone.precision;		this.mess = clone.mess;		this.complexity = clone.complexity;		this.range = clone.range;		this.type = clone.type;		this.value = clone.value;		this.dur = clone.dur;		this.critrate = clone.critrate;		this.avoidrate = clone.avoidrate;		this.agi = clone.agi;		this.push = clone.push;		this.DPH = clone.DPH;		this.surplus = clone.surplus;		this.asking = clone.asking;		this.answers = clone.answers;

	}	public WeaponPo( Map<String, String> data ){		id = Integer.parseInt( StringUtil.convertNumberString( data.get("id") ) );		room = Integer.parseInt( StringUtil.convertNumberString( data.get("room") ) );		en = Integer.parseInt( StringUtil.convertNumberString( data.get("en") ) );		precision = Integer.parseInt( StringUtil.convertNumberString( data.get("precision") ) );		mess = Integer.parseInt( StringUtil.convertNumberString( data.get("mess") ) );		complexity = Integer.parseInt( StringUtil.convertNumberString( data.get("complexity") ) );		range = Integer.parseInt( StringUtil.convertNumberString( data.get("range") ) );		type = data.get("type");		value = data.get("value");		dur = Integer.parseInt( StringUtil.convertNumberString( data.get("dur") ) );		critrate = Integer.parseInt( StringUtil.convertNumberString( data.get("critrate") ) );		avoidrate = Integer.parseInt( StringUtil.convertNumberString( data.get("avoidrate") ) );		agi = Integer.parseInt( StringUtil.convertNumberString( data.get("agi") ) );		push = Integer.parseInt( StringUtil.convertNumberString( data.get("push") ) );		DPH = Float.parseFloat( StringUtil.convertNumberString( data.get("DPH") ) );		surplus = Integer.parseInt( StringUtil.convertNumberString( data.get("surplus") ) );		asking = data.get("asking");		answers = data.get("answers");

	}}